import { Route } from "react-router-dom";
import AllMeetupsPage from "./pages/AllMeetups";
import FavoritesPage from "./pages/Favorites";
import NewMeetup from "./pages/NewMeetup";

const App = () => {
  return (
    <>
      <Route path="/">
        <AllMeetupsPage />
      </Route>
      <Route path="/">
        <NewMeetupPage />
      </Route>
      <Route path="/">
        <FavoritesPage />
      </Route>
    </>
  );
};

export default App;
